  "prompt": "Create a cheerful and vibrant logo for 'Camp Funshine', a summer camp for children. The logo should feature a stylized sun with a smiling face, radiating warmth and happiness. The sun should be rising behind a green mountain, symbolizing adventure and exploration. Include a blue lake at the foothills of the mountain, reflecting the sun's rays. The camp's name, 'Camp Funshine', should be prominently displayed in a playful, kid-friendly font at the bottom of the logo. The overall color scheme should be bright and inviting, with a focus on sunny yellows, greens, and blues to represent the outdoor summer camp theme."
